  inventory_count INT,
  avg_daily_sales INT
);

CREATE TABLE warehouse_performance_metrics (
    warehouse_id INT NOT NULL,
    total_sales DECIMAL,
    total_orders INT,
    total_inventory INT
);

CREATE TABLE sales_metrics (
    sales_id INT NOT NULL,
    warehouse_id INT NOT NULL,
    sales_amount DECIMAL,
    sales_date DATE
);

CREATE TABLE order_metrics (
    order_id INT NOT NULL,
    warehouse_id INT NOT NULL,
    order_quantity INT,
    order_date DATE
);

