    inventory_id INT NOT NULL,
    warehouse_id INT NOT NULL,
    product_name VARCHAR(255),
    quantity_on_hand INT
);

CREATE TABLE warehouse_sales (
    date DATE,
    total_sales DECIMAL,
    product_id INT,
    quantity INT
);

